import logo from './paypal-logo.jpeg';
import './App.css';
import { TextField } from '@mui/material';

// const RedditTextField = styled((props: TextFieldProps) => (
//   <TextField
//     InputProps={{ disableUnderline: true } as Partial<OutlinedInputProps>}
//     {...props}
//   />
// ))(({ theme }) => ({
//   '& .MuiFilledInput-root': {
//     overflow: 'hidden',
//     borderRadius: 4,
//     backgroundColor: theme.palette.mode === 'light' ? '#F3F6F9' : '#1A2027',
//     border: '1px solid',
//     borderColor: theme.palette.mode === 'light' ? '#E0E3E7' : '#2D3843',
//     transition: theme.transitions.create([
//       'border-color',
//       'background-color',
//       'box-shadow',
//     ]),
//     '&:hover': {
//       backgroundColor: 'transparent',
//     },
//     '&.Mui-focused': {
//       backgroundColor: 'transparent',
//       boxShadow: `${alpha(theme.palette.primary.main, 0.25)} 0 0 0 2px`,
//       borderColor: theme.palette.primary.main,
//     },
//   },
// }));

function App() {
  return (
    <div>
      <div style={{width: '460px', margin: '0 auto'}}>
        <div id="login-section" style={{
          margin: '120px auto 0px',
          border: '1px solid #eaeced',
          borderRadius: '12px',
          overflow: 'hidden',
          padding: '30px 10% 50px',
          }}>
          <header style={{margin: '0 auto 13.116%', display: 'flex',
          justifyContent: 'center'}}>
            <img src={logo} style={{width: '34px', height: '40px'}}></img>
          </header>
          <div id="login-form" style={{padding: 'auto'}} >
            <TextField
              id="username"
              label="Email or mobile number"
              variant="outlined"
              margin="dense"
              fullWidth
            />
            <TextField
              id="password"
              label="Password"
              variant="outlined"
              type="password"
              margin="dense"
              fullWidth
            />
            <button id="button-login" type="submit" style={{
              backgroundColor: '#142c8e',
              color: 'white'
            }}>
              Log In
            </button>
            <div id="separator" style={{
              borderTop: '1px solid #cbd2d6',
              marginTop: '8.72%',
              marginBottom: '4.895%',
              height: '15px',
              textAlign: 'center',
              fontSize: '83.34%',
            }}>
              <span style={{
                backgroundColor: '#fff',
                padding: '0 0.5em',
                color: '#6c7378',
                top: '-0.7em',
                position: 'relative'
              }}>or</span>
            </div>
            <button id="button-sign-up" style={{
                border: '.0125rem solid #142c8e',
                color: '#142c8e',
            }}>Sign Up</button>
          </div>
          <div style={{
              position: 'relative',
              display: 'block',
              fontSize: '12px',
              marginTop: '72px',
          }}>
          </div>
        </div>
      </div>
      <footer style={{paddingTop: '14px', bottom: 0, position: 'relative'}}>
          <div class="legalFooter" style={{textAlign: 'center', padding: '14px', backgroundColor: '#F7F9FA'}}>
            <ul class="footerGroup" style={{listStyleType: 'none', textAlign: 'center', margin: 0, padding: 0}}>
              <li><a target="_blank" href="/au/smarthelp/contact-us" pa-marked="1">Help &amp; Contact</a></li>
              <li><a target="_blank" href="/au/webapps/mpp/ua/privacy-full" pa-marked="1">Privacy</a></li>
              <li><a target="_blank" href="/au/webapps/mpp/ua/legalhub-full" pa-marked="1">Legal</a></li>
              <li><a target="_blank" href="/au/webapps/mpp/country-worldwide" pa-marked="1">Worldwide</a></li>
            </ul>
          </div>
        </footer>
    </div>
  );
}

export default App;
